import React from "react";

export default function Profile() {
  return (
    <div>
      <h2>Profile</h2>
      <p style={{ marginTop: 10 }}>
        Вітаю! Ви авторизовані. Це приватна сторінка профілю, доступна лише після логіну.
      </p>
    </div>
  );
}
